package com.getinfo.gestaocontratual.utils;

import java.io.FileOutputStream;
import java.util.Base64;

public class Constantes {
    public static final String LOGO_BASE64 = "";

    public static void saveLogo() throws Exception {
        byte[] bytes = Base64.getDecoder().decode(LOGO_BASE64);
        try (FileOutputStream fos = new FileOutputStream("src/main/resources/static/images/getinfo-logo.png")) {
            fos.write(bytes);
        }
    }
}

